    false,nt"url": null,nt"notes": "This annual narrative report for Great
    Dismal Swamp National Wildlife Refuge outlines Refuge accomplishments during the
    1983 calendar year. The report begins with a summary of the year's highlights and
    weather conditions. Land acquisition is covered. The report includes a planning
    section which discusses the master plan, management planning, public participation,
    compliance with environmental and cultural resource mandates, and research and investigations.
    Refuge administration is outlined; information about personnel, youth programs,
    manpower programs, volunteer programs, funding, safety, and technical assistance
    is given. Habitat management is also covered; subjects include wetlands, forests,
    croplands, fire management, and pest control. The wildlife section of the report
    discusses wildlife diversity, endangered and threatened species, waterfowl, marsh
    birds and waterbirds, shorebirds, raptors, game mammals, fisheries resources, scientific
    collections, marking and bird banding, and disease control. The public uses of the
    Refuge described in this report include outdoor classrooms, interpretive programs,
    hunting, fishing, wildlife observation, outdoor recreation, and law enforcement.
    The equipment and facilities section of the report provides information about new
    construction, rehabilitation, major maintenance, equipment replacement, communication
    systems, and energy conservation. Cooperative programs and items of interest are
    provided at the end.",nt"license_title": "License Not Specified",nt"extras":
